package uploadfile.upload;

public class Picture {
	private int id;
	private String demo;
	private String filer_url;
	private String username;
	public int getId() {
		return id;
	}
	public String getDemo() {
		return demo;
	}
	public void setDemo(String demo) {
		this.demo = demo;
	}
	public String getFiler_url() {
		return filer_url;
	}
	public void setFiler_url(String filer_url) {
		this.filer_url = filer_url;
	}
	public String getUsername() {
		return username;
	}
	public void setUsername(String username) {
		this.username = username;
	}
	public void setId(int id) {
		// TODO Auto-generated method stub
		this.id = id;
		
	}


}
